import React from "react";
import { GrFacebook } from 'react-icons/'



function Social(){
    return(
        
        <div class="social">
               
            <a href="facebook"><GrFacebook/> logof</a>
            <a href="tweeter"><i class="fab fa-twitter-square"></i>logot</a>
            <a href="instagram"><i class="fab fa-instagram-square"></i>logoi</a>
            <p>&copyDerechos reservados Instituto ILAP - Soportado por Moodle.org</p>
        </div>
    
    
        
    )
}

export default Social;
